import React from "react";
import {Link} from 'react-router-dom'

function Navbar(){
    return(
        <div class="navbar">
            <link to="/" className="navbar-logo">ToDoList</link>
            <ul className="navigation">
                <li>
                    <Link to="/">Categories</Link>
                </li>
            </ul>
        </div>
    )
}

export default Navbar;
